import React from "react";
import { Button, Nav, Navbar } from "react-bootstrap";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <>
      <Navbar bg='dark' variant='dark'>
        <Navbar.Brand href='/'> Registro e Acompanhamento de Ocorrências </Navbar.Brand>
        <Nav>
          <Nav.Item as={Link} className="nav-link" to="/">
            Início
          </Nav.Item>
          <Nav.Item as={Link} className="nav-link" to="/ocorrencias">
            Ocorrências
          </Nav.Item>
          <Nav.Item as={Link} className="nav-link" to="/ocorrencias_cadastro">
            Castradr
          </Nav.Item>
          <Nav.Item as={Link} className="nav-link" to="/dashboard">
            Dashboard
          </Nav.Item>
        </Nav>
      </Navbar>
    </>
  );
};

export default Header;
